deck_description:
I draw cards like it's my passionate hobby with my Danger deck, so I'm really just bringing that concept to it's logical conclusion;

Draw.
'Dem.
Cards.

Use tactical applications of Danger monsters, their friends and comrades, extra deck monsters, draw spells and general shenanigans to draw into EEEEXODIAAAA!
Failing that, you can still make a decent board, all things considered, and if your opponent just runs too many negates for your taste, feel free to side in the 'no fun allowed' cards. Just make sure to put off summoning Majesty's Fiend for as long as possible, as it will stop your fun also. &gt;_&gt;

